column13:
For printers:
 It was used very rarely in half a year, no more than 8 times, and it was reported for maintenance twice;
 Customer service:
 Calling the customer service hotline is a waste of time! It takes an average of 15 minutes at a time, and all time is wasted waiting on the hotline;
 Secondly, the online technicians do not understand technical operations, which is ridiculous. On the one hand, I don’t know what’s wrong with it. On the other hand, if I pull out the ink tube when sending it for inspection, it is easy for air to enter. I don’t know this common sense. Third, the delivery address is too far away.
